⁣
New clothes require resources and energy, and inevitably create some waste; even those from ethical and sustainable brands! Unfortunately, the truth is that all the system change in the world won't allow us to consume at our current rates, because we live on a planet with finite resources. ⁣
⁣
A report by @c40cities discussed the system changes and reduction in consumption that will be necessary to limit global warming to 1.5c. It states that we would each ideally buy a maximum of 3 new items of clothing per year. This report also recommends a fashion industry based mainly around recycling, upgrading, renting, and reuse of clothes, alongside a 75% reduction in supply chain waste.⁣
⁣
It's important to recognise that we can't just take the fast fashion mindset and apply it to ethical + sustainable brands. The opposite of fast fashion is slow fashion: consuming less, mending more, and wearing second hand. It's not just about what we buy, but also how much and how often. ⁣
⁣
